import React from "react";

export default () => (
  <Router>
    <>
      <NavBar></NavBar>
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/Dev" exact component={Dev} />
        <Route path="/UX" exact component={UX} />
      </Switch>
    </>
  </Router>
);
